import { Content } from "./styles"

const PinkOctober = () => {
  return (
    <>
      <Bar />
      <Content>
        <div className="content">
          <h2>Você sabe o que é Outubro Rosa?</h2>

        </div>
      </Content>
    </>
  )
};

export default PinkOctober;
